In practice, Huffman coders lie at the end of any compression pipeline and need to be extremely fast. Let's look at the typical encoding/decoding and see how we can speed it up. For simplicity and clarity we will work with a small exmaple. Let's say this is our given code: encoding_table = {"A": 0, "B": 10, "C": 110, "D": 111} The encoding itself is quite simple and involves looking at a lookup table. ## Prefix-free code encoding
encoding_table = {"A": 0, "B": 10, "C": 110, "D": 111}
def encode_symbol(s): bitarray = encoding_table[s] return bitarray, len(bitarray) The typical prefix-free code decoding works by parsing through the prefix-free tree, until we reach a leaf node, e.g. see the code in SCL: https://github.com/kedartatwawadi/stanford_compression_library/blob/main/compressors/prefix_free_compressors.py . Here is a pseudo-code for the decoding algorithm: ## Prefix-free code decoding: prefix_free_tree = ... # construct a tree from the encoding_table
def decode_symbol_tree(encoded_bitarray): # initialize num_bits_consumed num_bits_consumed = 0 # continue decoding until we reach leaf node curr_node = prefix_free_tree.root_node while not curr_node.is_leaf_node: bit = encoded_bitarray[num_bits_consumed] if bit == 0: curr_node = curr_node.left_child else: curr_node = curr_node.right_child num_bits_consumed += 1 # as we reach the leaf node, the decoded symbol is the id of the node decoded_symbol = curr_node.id return decoded_symbol, num_bits_consumed Although this is quite simple, there are a lot of branching instructions (e.g. if, else conditions). These instructions are not the fastest instructions on modern architectures. So, here is an alternative decoding procedure for this example: ## faster decoding
state_size = 3
decode_state = { 000: "A", 001: "A", 010: "A", 011: "A", 100: "B", 101: "B", 110: "C", 111: "D",
}
codelen_table = { "A": 1, "B": 2, "C": 3, "D": 3,
}
def decode_symbol_tree(encoded_bitarray): state = encoded_bitarray[:state_size] decoded_symbol = decode_state[state] num_bits_consumed = codelen_table[decoded_symbol] return decoded_symbol, num_bits_consumed Looking at the new decoding pseudo-code, we see following observations: The state_size=3 corresponds to the maximum depth of the prefix-free tree. The state is the first 3 bits of the encoded_bitarray. We use the state as an index to query thr decode_state lookup table to obtain the decoded_symbol. As the state is sometimes reading in more bits that what we wrote, we need to output the num_bits_consumed correctly to be codelen_table[decoded_symbol]. One natural question is why should the decoded_symbol = decode_state[state] operation output the correct state? The reason is because of the prefix-free nature of the codes. So, if we look at the entries in decode_state table corresponding to B, we see that these are 100, 101 both of which start with 10 which is the codeword corresponding to B. Based on first look, the decoding is indeed simpler with this new decoding procedure, but we do have to pay some cost. The cost is in terms of memory consumption. For example, we now need to maintain a table decode_state which has size 2∣maxdepth∣. This is clearly more memory than a typical prefix-free tree. In a way we are doing some caching. But for caching to work properly, the table sizes need to be small. The bigger the lookup table, the slower the table lookup is. So, practically the maximum leaf depth needs to be kept in check. Thus, practically we want to get a Huffman tree with a maximum leaf depth constraint. Typically, the depth is also set to be 16 or 24 so that it is a byte multiple. For more details on efficient Huffman Coding, we encourage the reader to have a look at this blog entry by Fabian Giesen on Huffman coding: https://fgiesen.wordpress.com/2021/08/30/entropy-coding-in-oodle-data-huffman-coding/?hmsr=joyk.com&utm_source=joyk.com&utm_medium=referral .
